import React from 'react'
import styled from 'styled-components'
import { Link } from 'react-scroll'
import AccountMenu from './AccountMenu'


const HeaderContainer = styled.header`
  display: flex;
  justify-content: space-between;
  padding: 30px 100px;
  background-color: #000;
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  z-index: 1000;
`;

const Nav = styled.nav`
  display: flex;
  gap: 20px;
`;

const NavLink = styled(Link)`
  color: #fff;
  font-size: 16px;
  font-weight: bold;
  cursor: pointer;
  &:hover {
    color: pink;
  }
`;

const Header = () => {
  return (
    <HeaderContainer>
      <img src={require('../images/logo.png')} alt='Wrepit Company Logo' />
      <Nav>
        <NavLink to='home' smooth={true} duration={1000}>
          Home
        </NavLink>
        <NavLink to='features' smooth={true} duration={1000}>
          About Us
        </NavLink>
        <NavLink to='support' smooth={true} duration={1000}>
          Features
        </NavLink>
        <NavLink to='examples' smooth={true} duration={1000}>
          Examples
        </NavLink>
        <NavLink to='contact' smooth={true} duration={1000}>
          Contact
        </NavLink>
        {isProfilePage ?
          (
            <NavLink to='contact' smooth={true} duration={1000}>
              Logout
            </NavLink>
          )
          :
          (
            <AccountMenu />
          )}
      </Nav>
    </HeaderContainer>
  );
};

export default Header;
